logging.getLogger().setLevel("DEBUG")
script = open("client.js").read()
html = open("index.html").read()


class Live:
    def __init__(self) -> None:
        token = os.getenv("HF_TOKEN")
        args: dict = {"use_auth_token": token} if token else {"local_files_only": True}
        # self.txt_pipe = StableDiffusionAITPipeline.from_pretrained(
        #     "CompVis/stable-diffusion-v1-4",
        #     revision="fp16",
        #     torch_dtype=torch.float16,
        #     safety_checker=None,
        #     **args,
        # ).to("cuda")

    def generate(self, params: dict) -> str:
        print("generated")
        return "data:image/webp;base64,"
        shared_params = {
            "prompt": params["prompt"],
            # maybe use num_images_per_prompt? think about batch v serial
            "height": params.get("height", 512),
            "width": params.get("width", 512),
            "num_inference_steps": params.get("ddim_steps", 35),
            "guidance_scale": params.get("scale", 7.5),
        }
        logging.info(params["prompt"])
        rng = torch.Generator(device="cuda").manual_seed(int(params.get("seed", 42)))
        start = time.time()
        output = self.txt_pipe(generator=rng, **shared_params)
        logging.info("took %s", round(time.time() - start, 3))
        buf = BytesIO()
        output.images[0].save(buf, format="webp")
        buf.seek(0)
        return f"data:image/webp;base64,{base64.b64encode(buf.read()).decode()}"

    async def index(self, req: web.Request) -> web.Response:
        return web.Response(body=html, content_type="text/html")

    async def js(self, req: web.Request) -> web.Response:
        return web.Response(body=open("client.js").read(), content_type="application/javascript")
        return web.Response(body=script, content_type="application/javascript")

    async def handle_ws(self, request: web.Request) -> web.Response:
        ws = web.WebSocketResponse()
        await ws.prepare(request)
        logging.info("ws connected")
        async for msg in ws:
            print(msg)
            if isinstance(msg.data, str) and msg.data.startswith("ping"):
                await ws.send_str("pong" + msg.data[4:])
            else:
            # async with generate_lock:
                image = self.generate(json.loads(msg.data))
                await ws.send_str(image)
        print("websocket disconnected")
        return ws

    async def offer(self, request: web.Request) -> web.Response:
        print("handling offer")
        params = await request.json()
        offer = RTCSessionDescription(sdp=params["sdp"], type=params["type"])

        pc = RTCPeerConnection()
        pc_id = "PeerConnection(%s)" % uuid.uuid4()
        pcs.add(pc)

        def log_info(msg, *args):
            pc_logger.info(pc_id + " " + msg, *args)

        log_info("Created for %s", request.remote)

        @pc.on("datachannel")
        def on_datachannel(channel: aiortc.rtcdatachannel.RTCDataChannel) -> None:
            print(type(channel))

            @channel.on("message")
            def on_message(message):
                print(message)
                if isinstance(message, str) and message.startswith("ping"):
                    channel.send("pong" + message[4:])
                if isinstance(message, str) and message[0] == "{":
                    print("will generate")
                    image = self.generate({}) #json.loads(msg.data))
                    print("sending")
                    channel.send(image)

        @pc.on("connectionstatechange")
        async def on_connectionstatechange() -> None:
            log_info("Connection state is %s", pc.connectionState)
            if pc.connectionState == "failed":
                await pc.close()
                pcs.discard(pc)

        # handle offer
        await pc.setRemoteDescription(offer)

        # send answer
        answer = await pc.createAnswer()
        await pc.setLocalDescription(answer)

        return web.Response(
            content_type="application/json",
            text=json.dumps(
                {"sdp": pc.localDescription.sdp, "type": pc.localDescription.type}
            ),
        )

    async def on_shutdown(self, app: web.Application) -> None:
        # close peer connections
        coros = [pc.close() for pc in pcs]
        await asyncio.gather(*coros)
        pcs.clear()


app = web.Application()
live = Live()
app.on_shutdown.append(live.on_shutdown)
app.add_routes(
    [
        web.route("*", "/", live.index),
        web.route("*", "/client.js", live.js),
        web.post("/offer", live.offer),
        web.get("/ws", live.handle_ws),
    ]
)

if __name__ == "__main__":
    web.run_app(app, port=8080, host="0.0.0.0")
